export default function Achievements() {
  const achievements = [
    {
      title: "2nd Prize – Virtuosic Hackathon",
      organization: "SSPM COE",
      description:
        "Awarded 2nd place in the Virtuosic Hackathon organized by SSPM College of Engineering for the innovative Result Analytics Dashboard project.",
      image: "/images/hackathon_award.png", // Replace with your image path
    },
    {
      title: "Research Paper Published – IEEE ICSSAS 2025",
      organization: "IEEE ICSSAS",
      description:
        "Published a research paper on predictive analytics and student performance monitoring in the IEEE International Conference on Smart Systems and Advanced Studies (ICSSAS) 2025.",
      image: "/images/ieee_paper.png", // Replace with your image path
    },
  ];

  return (
    <section className="testimonial--section" id="myintrest">
      <div className="portfolio--container-box">
        <div className="portfolio--container">
          <h2 className="skills--section--heading">My Achievements</h2>
        </div>
      </div>
      <div className="portfolio--section--container">
        {achievements.map((item, index) => (
          <div key={index} className="testimonial--section--card">
            <p className="text-md">{item.description}</p>
            <div className="testimonial--section--card--author--detail">
              <img src={item.image} alt={item.title} />
              <div>
                <p className="text-md testimonial--author--name">
                  {item.title}
                </p>
                <p className="text-md testimonial--author--designation">
                  {item.organization}
                </p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
